import React from 'react';
import ReturndAsh from './Dash';


// Dash board view 
export default function DAsh() {
 return (
  <div>
   {
    loading ?
     <div className='App-loading'>
      <GridLoader
       size={15}
       color={'#00b8d4'}
       loading={loading}
      />
     </div>
     :
     <ReturndAsh />
   }
  </div>
 );
};
